import sys
input = sys.stdin.readline

def rotate_90_ccw(x, y):
    return -y, x

def rotate_180(x, y):
    return -x, -y

def rotate_90_cw(x, y):
    return y, -x

def reflect_x(x, y):
    return x, -y


def solve():
    parts = input().split()
    n = int(parts[0])
    ops = parts[1] if len(parts) > 1 else ""
    out = []

    # Determine the net effect of the operations
    net_rotation = 0  # 0: none, 1: 90° CCW, 2: 180°, 3: 90° CW
    reflect_x_axis = False

    for op in ops:
        if op == 'R':
            net_rotation = (net_rotation + 1) % 4
        elif op == 'H':
            net_rotation = (net_rotation + 2) % 4
        elif op == 'D':
            net_rotation = (net_rotation + 3) % 4
        elif op == 'X':
            reflect_x_axis = not reflect_x_axis

    for _ in range(n):
        x, y = map(int, input().split())

        # Apply net rotation
        if net_rotation == 1:
            x, y = rotate_90_ccw(x, y)
        elif net_rotation == 2:
            x, y = rotate_180(x, y)
        elif net_rotation == 3:
            x, y = rotate_90_cw(x, y)

        # Apply reflection if needed
        if reflect_x_axis:
            x, y = reflect_x(x, y)

        out.append(f"{x} {y}")
    print('\n'.join(out))

solve()
